import React from "react";
import Card1 from "../images/Card 1.png"
import Card1Back from "../images/Card1Back.png"


export default function Services(){

    const flipCard = {
        backgroundColor: "transparent",
        width: "539px",
        height: "668px",
        perspective: "1000px",

        "&:hover": {
            transform: "rotateY(180deg)",
        }
    }

    const flipCardInner = {

        position: "relative",
        width: "100%",
        height: "100%",
        textAlign: "center",
        transition: "transform 0.8s",
        transformstyle: "preserve-3d",
        transform: "rotateY(180deg)",
    }

    const flipCardFront = {
        objectStyleBackfaceVisibility: "hidden",
        position: "absolute",
        width: "100%",
        height: "100%",
    }

    const flipCardBack = {
        transform: "rotateY(180deg)",
        objectStyleBackfaceVisibility: "hidden",
        position: "absolute",
        width: "100%",
        height: "100%",
    }



    return(
        <div>
            <div className="flex flex-col justify-start mx-20 ">
                <hr className="bg-black border-black h-[1px] w-[100%] "></hr>
                <h2 className="text-[55px]">Services</h2>
            </div>

            <div style={flipCard}>
                <div style={flipCardInner}>
                    <div style={flipCardFront}><img src={Card1}></img></div>
                    <div style={flipCardBack}><img src={Card1Back}></img></div>
                </div>
            </div>

        </div>
    )
}
